import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

// Components
import Navbar from './components/Navbar';
import PrivateRoute from './components/PrivateRoute';

// Pages
import Login from './components/Login';  // We'll create this or rename
import RegisterPage from './pages/RegisterPage';
import VisitorDashboard from './pages/VisitorDashboard';
import AuthorityDashboard from './pages/AuthorityDashboard';
import ReportPage from './pages/ReportPage';
import TrackReport from './pages/TrackReport';

// Simple Home page
const Home = () => (
  <div className="container mt-5">
    <h1>Welcome to CareMyPark</h1>
    <p>Select an option from the navigation menu</p>
  </div>
);

// Simple Login component (you can replace with your actual Login)
const LoginSimple = () => (
  <div className="container mt-5">
    <h2>Login Page</h2>
    <p>Login functionality will be implemented here</p>
  </div>
);

function App() {
  return (
    <Router>
      <Navbar />
      <div className="container mt-4">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<LoginSimple />} />
          <Route path="/register" element={<RegisterPage />} />
          <Route path="/report" element={<ReportPage />} />
          <Route path="/track" element={<TrackReport />} />
          
          {/* Protected Routes */}
          <Route path="/dashboard" element={
            <PrivateRoute>
              <VisitorDashboard />
            </PrivateRoute>
          } />
          
          <Route path="/authority" element={
            <PrivateRoute requiredRole="authority">
              <AuthorityDashboard />
            </PrivateRoute>
          } />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
